import { useRoutes } from 'react-router-dom'
import ImageUploader from '../pages/ImageUploader.jsx'
import PDFview from '../pages/PDFview.jsx'

const routers = [
    {
        path:'/',
        element:<ImageUploader/>
    },
    {
        path:'/ImageUploader',
        element:<ImageUploader/>
    },
    {
        path:'/PDFview',
        element:<PDFview/>
    }
]


 const newRouter = () => {
    const useRouters = useRoutes(routers)
    return useRouters
}

export default newRouter
